package main

import (
	"fmt"
)

/*
给定一个字符串s，
是否可以由一个空字符串经过如下操作得到s：
	在空串的任意位置添加"abc" 任意次数，是否可以得到字符串s
例如 s="abcaababcc" 即可由上面的操作得到
这道题正向的去看好像比较难搞，因为一旦插入的次数变多之后，我们就很难判断由多少个abc存在了，也就很难去推断是否可以由空串转换而来

因此可以反向的去看，即字符串s是否可以转换为空串，当我们拿到字符串s的时候，s中至少是有一个"abc"的，若一个都没有，则s肯定不能由插入"abc"获得
当我们找到这个"abc"并且把它去除，再继续找剩下的是否还有abc，再去除，最后全部去除之后变成一个空字符串，就说明可以转换而来，否则不可以

如何才能找到abc，我们可以遍历这个s，当遇到a b直接将其放入堆栈中，遇到c则判断堆栈的最后两个位置是否为a b，若是ab，表明这三个字母可以组成abc，然后将
堆栈的最后两位删除，若不是ab，则直接返回false。
*/
func isValid(s string) bool {
	if len(s) < 3 {
		return false
	}

	var stack []byte
	sb := []byte(s)
	for i := 0; i < len(sb); i++ {
		if sb[i] == 'c' {
			if len(stack) >= 2 && stack[len(stack)-1] == 'b' && stack[len(stack)-2] == 'a' {
				stack = stack[:len(stack)-2]
			} else {
				return false
			}
		} else {
			stack = append(stack, sb[i])
		}
	}
	if len(stack) == 0 {
		return true
	}
	return false
}

func main() {
	s := ""
	fmt.Println(isValid(s))
}
